import React from "react";
import {Col} from "react-bootstrap"

export default function Product(props){

    return (
    <Col sm={'auto'} style={{backgroundColor:'red',margin:'10px'}}  id={props.item.id} key={props.item.id} onClick={(e)=>{props.getDetails(props.item.id)}}>
        <h4>{props.item.name}</h4>
        <p>{props.item.description}</p>
        <p>{props.item.category}</p>
        <p><i>Price :</i>{props.item.default_price}</p>
    </Col>
    );
}
